from data.database import engine, Basefrom data.models import Wordfrom data.word_bank import wordsfrom data.database import sessionimport jsonBase.metadata.create_all(bind=engine)print("Successfully Connect!")session1 = session(bind=engine)for word in words:    new_word = Word(        word=word['text'],        word_info=json.dumps(word)    )    session1.add(new_word)    session1.commit()print("Success!")